="clcommon__Address__c" value="null" enclosevalueinquotes="false"/></renderconditions><enableconditions/></field></fields><renderconditions logictype="and"/></section></sections></column></columns></fields></section></sections><renderconditions logictype="and"/></column></columns><renderconditions logictype="and"/></basicfieldeditor><basicfieldeditor showheader="true" showsavecancel="false" showerrorsinline="true" model="Account" uniqueid="sk-2Eda-9233" mode="edit"><columns layoutmode="fixed"><column width="100%" uniqueid="sk-2Eda-9234"><sections><section title="Mailing Address" collapsible="no" uniqueid="sk-2Eda-9235"><fields/><renderconditions logictype="and"><rendercondition type="fieldvalue" operator="=" enclosevalueinquotes="true" fieldmodel="Account" sourcetype="fieldvalue" field="Is_the_postal_address__c" fieldtargetobjects="Account" value="No"/></renderconditions></section><section title="New Section" collapsible="no" uniqueid="sk-2Eda-9236" showheader="false"><fields><columns uniqueid="sk-2Eda-9237"><column width="100%" uniqueid="sk-2Eda-9238"><sections><section title="New Section" collapsible="no" uniqueid="sk-2Eda-9239" showheader="false"><fields><field uniqueid="sk-2Eda-9240" type="COMBO" editmodebehavior="autopopup" allowhtml="true"><label>Address</label><renderconditions logictype="and" onhidedatabehavior="keep"><rendercondition type="fieldvalue" operator="=" enclosevalueinquotes="false" fieldmodel="ApplicationRen" sourcetype="fieldvalue" nosourcerowbehavior="deactivate" field="Is_Approved__c" fieldtargetobjects="genesis__Applications__c" value="false"/></renderconditions><enableconditions/><template>&lt;!DOCTYPE html&gt;
&lt;html&gt;

&lt;head&gt;
    &lt;script&gt;
        var autocomplete5,
            accModelSMSFMailing = skuid.model.getModel('AccountShippingAddress'),
            accRowSMSFMailing = accModelSMSFMailing.data[0],
            autoCompleteInput5 = document.getElementById('CompanyRegisteredAddress');
            //Google Place Initialize
            function initAutocompleteRegisterAddress() {
                autocomplete5 = new google.maps.places.Autocomplete(autoCompleteInput5, {types: ['geocode']});

                //Restrict the google place only show the specified country address and not allow other country address.
                autocomplete5.setComponentRestrictions({
                   country: ["aus"]
                });

                google.maps.event.addListener(autocomplete5, "place_changed", function() {
                  var place = autocomplete5.getPlace();
                  autoCompleteInput5.value = place.formatted_address;
                  if(place){
                    var formatted_address = place.formatted_address;
                    var placeComponent = place.address_components;
                    fillInAddress(placeComponent,formatted_address);
                  }else{
                    alert('Address not found.Please check your address details.');
                  }
                });
            }

            //Address data fillup for each type.
            function fillInAddress(placeComponent,formatted_address) {
              $.each(placeComponent,function(i,rowSMSFMailing){
                    if(rowSMSFMailing.types=='premise' || rowSMSFMailing.types=='route'){
                        var fullStreetName = rowSMSFMailing.long_name.split(" ");
                        var lengthFullStreetName = fullStreetName.length;
                        if(lengthFullStreetName == 2){
                             accModelSMSFMailing.updateRow(accRowSMSFMailing,{
                                Street_Name__c : rowSMSFMailing.long_name.split(" ")[0]
                            });
                        }
                        else if(lengthFullStreetName &gt; 2){
                            var streetName='';
                            for(var i=0;i&lt;lengthFullStreetName-1;i++){
                                streetName = streetName + rowSMSFMailing.long_name.split(" ")[i]+' ';
                            }
                            accModelSMSFMailing.updateRow(accRowSMSFMailing,{
                                Street_Name__c : streetName
                            });
                        }
                        accModelSMSFMailing.updateRow(accRowSMSFMailing,{
                            Street_Type__c : rowSMSFMailing.long_name.split(" ")[lengthFullStreetName-1]
                        });
                        accModelSMSFMailing.updateRow(accRowSMSFMailing,{
                            Duplicate_Street_Type__c : rowSMSFMailing.short_name.split(" ")[lengthFullStreetName-1]
                        });
                    }
                    else if(rowSMSFMailing.types.includes('sublocality_level_1')){
                        var fullStreetName = rowSMSFMailing.long_name.split(" ");
                        var lengthFullStreetName = fullStreetName.length;
                        if(lengthFullStreetName == 2){
                            accModelSMSFMailing.updateRow(accRowSMSFMailing,{
                                Street_Name__c : rowSMSFMailing.long_name.split(" ")[0]
                            });
                        }
                        else if(lengthFullStreetName &gt; 2){
                            var streetName='';
                            for(var i=0;i&lt;lengthFullStreetName-1;i++){
                                streetName = streetName + rowSMSFMailing.long_name.split(" ")[i]+' ';
                            }
                            accModelSMSFMailing.updateRow(accRowSMSFMailing,{
                                Street_Name__c : streetName
                            });
                        }
                        accModelSMSFMailing.updateRow(accRowSMSFMailing,{
                            Street_Type__c : rowSMSFMailing.long_name.split(" ")[lengthFullStreetName-1]
                        });
                        accModelSMSFMailing.updateRow(accRowSMSFMailing,{
                            Duplicate_Street_Type__c : rowSMSFMailing.short_name.split(" ")[lengthFullStreetName-1]
                        });
                    }
                    else if(rowSMSFMailing.types.includes('locality')){
                        accModelSMSFMailing.updateRow(accRowSMSFMailing,{
                            clcommon__City__c : (rowSMSFMailing.long_name).toUpperCase()
                        });
                    }
                    else if(rowSMSFMailing.types.includes('administrative_area_level_1')){
